import {
    START_SESS,
    END_SESS,
    SET_PROFILE_TAB,
    SET_COMPANY_TAB,
} from './types';

export const setProfileTab = (tab) => (dispatch) => {
    dispatch({ type: SET_PROFILE_TAB, payload: tab });
};
export const setCompanyTab = (tab) => (dispatch) => {
    dispatch({ type: SET_COMPANY_TAB, payload: tab });
};
